// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

import "./RakToken.sol";

contract NewPool is Ownable {
    /**
     * @notice Safe guarding contract from integer
     * overflow and underflow vulnerabilities.
     */
    using SafeMath for uint256;

    /**
     * @notice Enum to specify the current state of loan repayment
     */
    enum Status {
        Pending,
        PartiallyPaid,
        Paid
    }

    /**
     * @notice struct to define the characteristics of a loan
     */
    struct LoanInfo {
        uint256 loanId;
        uint256 totalLoanedAmount;
        uint256 totalRepayAmount;
        address tokenAddress;
        address colateralAddress;
        uint256 blockNumber;
        Status status;
    }

    /**
     * @notice struct to define the characteristics of a Deposit
     */
    struct DepositInfo {
        uint256 amount;
        uint256 blockNumber;
        uint256 totalInterestEarned;
    }

    /**
     * @notice struct to define the characteristics of a
     * InterestInfo of a token
     */
    struct InterestInfo {
        uint256 depositInterest;
        uint256 borrowInterest;
    }

    /**
     * @notice mapping user address to token address to deposited amount
     */
    mapping(address => mapping(address => DepositInfo)) public userTokenBal;

    /**
     * @notice mapping token address to total token available
     */
    mapping(address => uint256) public totalTokenAvailable;

    /**
     * @notice mapping token address to total token borrowed
     */
    mapping(address => uint256) public totalTokenBorrowed;

    /**
     * @notice mapping user address to token address to user total locked balance
     */
    mapping(address => mapping(address => uint256)) public userTokenLockedBal;

    /**
     * @notice mapping user address to total loan count
     */
    mapping(address => uint256) public userLoanCount;

    /**
     * @notice mapping token address to struct IntersetInfo
     */
    mapping(address => InterestInfo) public tokenInterestInfo;

    /**
     * @notice mapping useraddress to eth balance
     */
    mapping(address => uint256) public ethBalance;

    /**
     * @notice keeps track of tokens registered
     */
    mapping(uint256 => address) public tokens;

    /**
     * @notice mapping user address to user loan data
     */
    mapping(address => LoanInfo[]) public userLoanData;

    /**
     * @notice stores no of token availabel
     */
    uint256 public tokenCount;

    /**
     * @notice block time of the network
     */
    uint256 public blockTime;

    /**
     * @notice oracle pricefeed interface
     */
    AggregatorV3Interface internal priceFeed;

    /**
     * @notice this variable stores the RakToken contract address
     */
    RakToken public rakToken;

    /**
     * @notice this event is for - when a user deposits ETH
     */
    event DepositedEth(address indexed depositor, uint256 amount);

    /**
     * @notice this event is for - when a user deposits Tokens
     */
    event DepositedToken(
        address indexed depositor,
        address indexed token,
        uint256 amount
    );

    /**
     * @notice this event is for - when a user borrows tokens
     */
    event Borrowed(
        address indexed borrower,
        address indexed token,
        uint256 amount
    );

    /**
     * @notice this event is for - when a user repays a loan
     */
    event Repaid(
        address indexed borrower,
        uint256 indexed loanId,
        uint256 amount
    );

    /**
     * @notice this event is for - when a user withdraws ETH
     */
    event WithdrawnEth(address indexed depositor, uint256 amount);

    /**
     * @notice this event is for - when a user withdraws tokens
     */
    event WithdrwanToken(
        address indexed depositor,
        address indexed token,
        uint256 amount
    );

    /**
     * @notice Constructor, which is a function that executes
     * once (on deployment) sets block time, price feed for oracle,
     * rakToken, Available rakTokens
     */
    constructor() {
        priceFeed = AggregatorV3Interface(
            0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        );
        blockTime = 14; // 14 seconds for Ethereum main net
        rakToken = new RakToken(100000000);
        totalTokenAvailable[address(rakToken)] = rakToken.balanceOf(
            address(this)
        );
    }

    /**
     * @notice This functions runs when user sends eth directly to the contract
     */
    receive() external payable {
        depositEth();
    }

    /**
     * @notice this function is used for registering a token
     * @param tokenAddress the address of the token
     */
    function registerToken(address tokenAddress) public onlyOwner {
        tokenCount = tokenCount.add(1);
        tokens[tokenCount] = tokenAddress;
    }

    /**
     * @notice Get the latest interest rate
     * @param tokenAddress the address of the token
     * @return utilityFactor the interest rate depends on supply and demand
     */
    function checkInterestInfo(address tokenAddress)
        public
        view
        returns (uint256)
    {
        uint256 totalBalance = totalTokenAvailable[tokenAddress];
        uint256 totalBorrow = totalTokenBorrowed[tokenAddress];
        uint256 utilityFactor = (totalBorrow.mul(100)).div(
            totalBalance.add(totalBorrow)
        );
        return utilityFactor;
    }

    /**
     * @notice Get the latest interest rate
     * @param tokenAddress the address of the token
     * @return tokenInterestInfo for depositor
     */
    function getDepositInterestRate(address tokenAddress)
        public
        returns (uint256)
    {
        uint256 num = 2500;
        uint256 interestRate = (num).add(
            checkInterestInfo(tokenAddress).mul(2)
        );
        return tokenInterestInfo[tokenAddress].depositInterest = interestRate;
    }

    /**
     * @notice Get the latest interest rate
     * @param tokenAddress the address of the token
     * @return tokenInterestInfo for borrower
     */
    function getBorrowerInterestRate(address tokenAddress)
        public
        returns (uint256)
    {
        uint256 num = 3000;
        uint256 interestRate = (num).add(
            checkInterestInfo(tokenAddress).mul(2)
        );
        return tokenInterestInfo[tokenAddress].borrowInterest = interestRate;
    }

    /**
     * @notice calculate and update depositor's interest
     * @param tokenAddress the address of the token
     */
    function calculateDepositorInterest(address tokenAddress) public {
        // duration in seconds from deposit block to this block
        uint256 duration = block
            .number
            .sub(userTokenBal[msg.sender][tokenAddress].blockNumber)
            .mul(blockTime);

        // calculating interest by (principle * APR/100 * duration in seconds) / seconds in a year
        uint256 secondsInYear = uint256(36525).mul(86400).div(100);
        uint256 interest = (userTokenBal[msg.sender][tokenAddress].amount)
            .mul(duration)
            .mul(getDepositInterestRate(tokenAddress))
            .div(100)
            .div(secondsInYear);
        userTokenBal[msg.sender][tokenAddress].amount = userTokenBal[
            msg.sender
        ][tokenAddress].amount.add(interest);
        userTokenBal[msg.sender][tokenAddress]
            .totalInterestEarned = userTokenBal[msg.sender][tokenAddress]
            .totalInterestEarned
            .add(interest);

        userTokenBal[msg.sender][tokenAddress].blockNumber = block.number;
    }

    /**
     * @notice calculate and update a specific loan interest and borrowers's repay amount
     * @param loanId the Loan Id of the Loan
     * @param tokenAddress the address of the token
     */
    function calculateLoanInterest(uint256 loanId, address tokenAddress)
        external
    {
        // duration in seconds from loan block to this block
        uint256 duration = block
            .number
            .sub(userLoanData[msg.sender][loanId - 1].blockNumber)
            .mul(blockTime);

        // calculating interest by (principle * APR/100 * duration in seconds) / seconds in a year
        uint256 secondsInYear = uint256(36525).mul(86400).div(100);
        uint256 principle = userLoanData[msg.sender][loanId - 1]
            .totalLoanedAmount -
            userLoanData[msg.sender][loanId - 1].totalRepayAmount;
        uint256 interest = (principle)
            .mul(duration)
            .mul(getBorrowerInterestRate(tokenAddress))
            .div(100)
            .div(secondsInYear);
        userLoanData[msg.sender][loanId - 1].totalLoanedAmount = userLoanData[
            msg.sender
        ][loanId - 1].totalLoanedAmount.add(interest);
        userLoanData[msg.sender][loanId - 1].blockNumber = block.number;
    }

    /**
     * @notice Get the latest price of eth to USD
     * @return price a tuple that contains price
     */
    function getLatestPrice()
        public
        view
        returns (
            uint80,
            int256,
            uint256,
            uint256,
            uint80
        )
    {
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        // for ETH / USD price is scaled up by 10 ** 8
        price = price / 1e8;
        return (roundID, price, startedAt, timeStamp, answeredInRound);
    }

    /**
     * @notice deposit eth to the pool
     * @return success true if success
     */
    function depositEth() public payable returns (bool success) {
        // (, int256 latestPrice, , , ) = getLatestPrice();
        // uint256 price = uint256(latestPrice);
        uint256 price = 2500;
        ERC20 tokenAddress = rakToken;
        ethBalance[msg.sender] = ethBalance[msg.sender].add(msg.value);
        uint256 tokenReq = price.mul(msg.value);
        uint256 interest = 1;
        DepositInfo memory newDeposit = DepositInfo(
            tokenReq,
            block.number,
            interest
        );
        userTokenBal[msg.sender][address(tokenAddress)] = newDeposit;
        totalTokenAvailable[address(tokenAddress)] = totalTokenAvailable[
            address(tokenAddress)
        ].add(tokenReq);

        emit DepositedEth(msg.sender, msg.value);
        return rakToken.transfer(msg.sender, tokenReq);
    }

    /**
     * @notice deposit ERC20 token to the pool
     * user gets rakToken for deposit
     * @param tokenAddress ERC20 token address
     * @param amount token deposited amount
     * @return success true if success
     */
    function depositToken(address tokenAddress, uint256 amount)
        public
        returns (bool success)
    {
        uint256 balance = userTokenBal[msg.sender][tokenAddress].amount.add(
            amount
        );
        totalTokenAvailable[tokenAddress] = totalTokenAvailable[tokenAddress]
            .add(amount);
        getDepositInterestRate(tokenAddress);
        getBorrowerInterestRate(tokenAddress);
        DepositInfo memory newDeposit = DepositInfo(balance, block.number, 0);
        userTokenBal[msg.sender][tokenAddress] = newDeposit;

        emit DepositedToken(msg.sender, tokenAddress, amount);
        //rakToken.transfer(msg.sender, value);
        return
            ERC20(tokenAddress).transferFrom(msg.sender, address(this), amount);
    }

    /**
     * @notice Withdraw deposited eth
     * @param amount amount to be withdrawn
     * @return success true if success
     */
    function withdrawEth(uint256 amount) public payable returns (bool success) {
        // require(ethBalance[msg.sender] >= amount, "low balance");
        // (, int256 latestPrice, , , ) = getLatestPrice();
        //uint256 price = uint256(latestPrice);
        uint256 price = 2500;
        uint256 bal = rakToken.balanceOf(msg.sender);
        uint256 withdrawableAmount = bal.sub(
            userTokenLockedBal[msg.sender][address(rakToken)]
        );
        require(withdrawableAmount >= amount, "low withdrawable amount");
        uint256 tokenReq = price.mul(amount);
        ethBalance[msg.sender] = ethBalance[msg.sender].sub(amount);
        totalTokenAvailable[address(rakToken)] = totalTokenAvailable[
            address(rakToken)
        ].sub(tokenReq);

        emit WithdrawnEth(msg.sender, amount);
        payable(msg.sender).transfer(amount);
        return rakToken.transferFrom(msg.sender, address(this), tokenReq);
    }

    /**
     * @notice Withdraw deposited ERC20 token
     * @param amount amount to be withdrawn
     * @param tokenAddress address of token
     * @return success true if success
     */
    function withdrawToken(uint256 amount, address tokenAddress)
        public
        payable
        returns (bool success)
    {
        require(
            userTokenBal[msg.sender][tokenAddress].amount >= amount,
            "low balance"
        );
        uint256 withdrawableAmount = userTokenBal[msg.sender][tokenAddress]
            .amount
            .sub(userTokenLockedBal[msg.sender][tokenAddress]);
        require(withdrawableAmount >= amount, "low withdrawable amount");
        //   (, int256 latestPrice, , , ) = getLatestPrice();
        //uint256 price = uint256(latestPrice);
        //uint tokenReq = price  * amount;
        // ERC20(rakToken).transferFrom(msg.sender,address(this),tokenReq);
        getDepositInterestRate(tokenAddress);
        getBorrowerInterestRate(tokenAddress);
        userTokenBal[msg.sender][tokenAddress].amount = userTokenBal[
            msg.sender
        ][tokenAddress].amount.sub(amount);
        totalTokenAvailable[tokenAddress] = totalTokenAvailable[tokenAddress]
            .sub(amount);

        emit WithdrwanToken(msg.sender, tokenAddress, amount);
        return ERC20(tokenAddress).transfer(msg.sender, amount);
    }

    /**
     * @notice user take loan
     * @param amount loan amount
     * @param tokenAddress loan token address
     * @param colateralAddress  colateral token address
     */
    function borrow(
        uint256 amount,
        address tokenAddress,
        address colateralAddress
    ) public returns (bool success) {
        require(
            userTokenBal[msg.sender][colateralAddress].amount >= amount,
            "insufficient collateral"
        );
        userTokenLockedBal[msg.sender][colateralAddress] = userTokenLockedBal[
            msg.sender
        ][colateralAddress].add(amount);
        userLoanCount[msg.sender] = userLoanCount[msg.sender].add(1);
        uint256 loanId = userLoanCount[msg.sender];
        LoanInfo memory newLoan = LoanInfo(
            loanId,
            amount,
            0,
            tokenAddress,
            colateralAddress,
            block.number,
            Status.Pending
        );
        getDepositInterestRate(tokenAddress);
        getBorrowerInterestRate(tokenAddress);
        userLoanData[msg.sender].push(newLoan);
        totalTokenBorrowed[tokenAddress] = totalTokenBorrowed[tokenAddress].add(
            amount
        );
        totalTokenAvailable[tokenAddress] = totalTokenAvailable[tokenAddress]
            .sub(amount);

        emit Borrowed(msg.sender, tokenAddress, amount);
        return ERC20(tokenAddress).transfer(msg.sender, amount);
    }

    /**
     * @notice loan repay function
     * @param amount loan amount
     * @param loanId loan id
     */
    function repay(uint256 amount, uint256 loanId) public returns (bool) {
        ERC20 colateralAddress = ERC20(
            userLoanData[msg.sender][loanId - 1].colateralAddress
        );
        require(
            userLoanData[msg.sender][loanId - 1].totalLoanedAmount !=
                userLoanData[msg.sender][loanId - 1].totalRepayAmount,
            "Loan already paid"
        );
        userLoanData[msg.sender][loanId - 1].totalRepayAmount = userLoanData[
            msg.sender
        ][loanId - 1].totalRepayAmount.add(amount);
        userTokenLockedBal[msg.sender][
            address(colateralAddress)
        ] = userTokenLockedBal[msg.sender][address(colateralAddress)].sub(
            amount
        );
        ERC20 tokenAddress = ERC20(
            userLoanData[msg.sender][loanId - 1].tokenAddress
        );
        totalTokenBorrowed[address(tokenAddress)] = totalTokenBorrowed[
            address(tokenAddress)
        ].sub(amount);
        totalTokenAvailable[address(tokenAddress)] = totalTokenAvailable[
            address(tokenAddress)
        ].add(amount);

        if (
            userLoanData[msg.sender][loanId - 1].totalLoanedAmount ==
            userLoanData[msg.sender][loanId - 1].totalRepayAmount
        ) {
            userLoanData[msg.sender][loanId - 1].status = Status.Paid;
        } else {
            userLoanData[msg.sender][loanId - 1].status = Status.PartiallyPaid;
        }

        emit Repaid(msg.sender, loanId, amount);
        return
            ERC20(tokenAddress).transferFrom(msg.sender, address(this), amount);
    }
}

